import "./Fifth.css";

const Fifth = () => {
  return (
    <div className='container'>
        <div className='row fifth-content'>
            <h2>Assisted Living With A Customized Care</h2>
            <div className='col-md-12 content1'>
            <img src='../fifth1.png'/>
            
            </div>
            

            
        </div>
    </div>
  )
}

export default Fifth
